import React from 'react';

const EditPost = (props) => {
    return(

    <div>
       <form onSubmit={props.editPost}>
            <input type="text" name="title" value={props.postToEdit.title} onChange={props.handleEdit}/>
            <input type="text" name="commentBody" value={props.postToEdit.commentBody} onChange={props.handleEdit}/>
            <input type="submit" value="submit"/>

       </form>
    </div>
    )

}

export default EditPost;
